void test_real_fir_filter() {
  uint32_t input_len = 923;
  uint32_t bw_idx = 2;
  struct timespec start_filter;
  float output[input_len];
  uint32_t filter_idx = 4;

  printf("Run simple real FIR filter test.\n");

  double filter_diff = 0.0, error = 0.0, local_error = 0.0;
  int i, numTrials = 1000;
  for(int j = 0; j < numTrials; j++) {
    clock_gettime(CLOCK_REALTIME, &start_filter);

    trx_filter_run_fir_filter_real(real_signal_input, input_len, bw_idx, filter_idx, output);

    filter_diff += helpers_profiling_diff_time(&start_filter);

    for(i = 0; i < input_len; i++) {
      //printf("output[%d] : %f - real_signal_output[%d]: %f\n",i,output[i],i,real_signal_output[i]);
      local_error = fabs(output[i] - real_signal_output[i]);
      error += local_error;
      if(local_error > 1e-5) {
        printf("output[%d] : %f - real_signal_output[%d]: %f - local_error: %e\n",i,output[i],i,real_signal_output[i],local_error);
      }
    }
  }

  printf("Avg. filter processing time: %f\n",filter_diff/numTrials);

  uint32_t trx_filter_length = trx_filter_get_filter_length();
  error = error/(trx_filter_length*numTrials);
  printf("Avg. Error: %e\n",error);
}

